import React, { Component } from 'react'
import './Eventcard.css'
import img from './ece1.jpg'
import Particles from 'react-particles-js';
// import './Exo-Regular.ttf'
// import './Oribitron.ttf'
class Eventcard extends Component {
	render() {

		return (
			<div className="container_event">
				{/* <h2 className="heading_event">EVENTS</h2>
				<div className="events">
					<div className="main-event">
						<div className="inner">

							 <img src={img} alt="aa" width="100%" className="event-img" /> 
							<h2>EVENT TEST</h2>
						</div>
						<div className="inner_bottom">
							<article className="events-desc"> Welcome to Sant Longowal Institute of Engineering and Technology (SLIET).</article>
							<button className="btn_event">Register</button>
						</div>

					</div>

				</div> */}
     <Particles
    params={{
	    "particles": {
	        "number": {
	            "value": 8,
	            "density": {
	                "enable": true,
	                "value_area": 800
	            }
	        },
	        "line_linked": {
	            "enable": false
	        },
	        "move": {
	            "speed": 1,
	            "out_mode": "out"
	        },
	        "shape": {
	            "type": [
	                "images",
	                "circle"
	            ],
	            "images": [
	                {
	                    "src": {img},
	                    "height": 20,
	                    "width": 23
	                },
	                {
	                    "src": {img},
	                    "height": 20,
	                    "width": 20
	                },
	                {
	                    "src": "/code.b3b4c4f4.png",
	                    "height": 20,
	                    "width": 20
	                }
	            ]
	        },
	        "color": {
	            "value": "#CCC"
	        },
	        "size": {
	            "value": 30,
	            "random": false,
	            "anim": {
	                "enable": true,
	                "speed": 4,
	                "size_min": 10,
	                "sync": false
	            }
	        }
	    },
	    "retina_detect": false
	}} />
			</div>
		)
	}
}

export default Eventcard;
